import Layout from "../components/Layout";
import Link from 'next/link';
import {authInitialProps} from '../lib/auth';

export default function Index(auth){
    console.log(auth);
    return (
        <Layout title="Home" {...auth}>
            <Link href="/profile">
                <a>
                Go to Profile
                </a>
            </Link>
        </Layout>
    )
}

Index.getInitialProps = authInitialProps();
